남편은 요즘 매일 인생 최대 몸무게를 갱신중이다.
그래서 매일 체중계에 올라가보더니
살을 빼야겠다며 인생 처음으로 다이어트를 결심,
다이어트 식품을 사겠다했다.
뭐든 스스로 잘 컨트롤하는 편이기에 
결심을 했으니 곧 빼겠구나 했는데, 

웬걸, 사놓은 다이어트 식품은 줄지 않고
과자며 라면만 줄고 있다!🤣🤣🤣🤣
(보상심리인지 일부러 그러는 것처럼
꼭 저녁에 말려도 꺼내먹는다...!!)

나 다이어트하려할 때마다
'다이어트해야지~~'로 시작하는 잔소리를 그렇게 하더니
해보니 그게 말처럼 쉬운 게 아닌 걸 알겠나보다.

그럴거면 그냥 포기하고 
맘이라도 편하게 먹어라싶은데
아침마다 30분이라도 운동하겠다며
꼬박꼬박 새벽에 일어나는 걸보면
빠져야 재미라도 있을텐데 싶다.

다이어트 한약이라도 지어줘야하나...;;ㅋ

여튼, 
이런 이유로 요즘 집밥을 거하게 먹을 수 없어
나만 먹고 싶은 게 쌓이는 중이다.

사진은 어제자 내 저녁밥인
냉털 볶음밥ㅋㅋ
